import React from 'react';
import styled from 'styled-components';
// import Illustration from './Illustration';

const TallContainer = styled.div`
  height: 30vh;
  display: block;
`;

const AboutPanelContainer = styled.div`
  margin: 0px auto;
  max-width: 1000px;
  align-content: center;
  text-align: center;
  @media (max-width: 48em) {
    display: block;
    max-width: 500px;
  }
`;

const AboutPanelTitle = styled.p`
  font-size: 20px;
  margin-top: 66px;
  font-weight: 400;
`;

const ContactList = styled.ul`
  /* margin: 20px 0px 0px; */
  /* list-style-position: outside; */
  list-style: none;
  margin-left: 0px;
  padding-left: 0px;

  li {
    margin-top: 6px;
    /* margin-left: 0px;
    padding-left: 0px; */
    font-size: 18px;
    color: ${(props) => props.theme.purple};
  }

  a {
    text-decoration: none;
    color: ${(props) => props.theme.purple};

    :hover {
      text-decoration: underline;
    }
  }

  i {
    color: ${(props) => props.theme.black};
  }
`;

export default function ContactPanel() {
  return (
    <TallContainer>
      <AboutPanelContainer>
        <AboutPanelTitle>Get In Touch</AboutPanelTitle>
        <ContactList>
          <li>
            <i class='fas fa-file' />
            <a
              href='https://drive.google.com/file/d/13PLzwQ_L7DixClIIPclUCYdomKWClo0-/view'
              target='_blank'
              rel='noopener noreferrer'
            >
              {' '}
              Resume
            </a>
          </li>
          <li>
            <i class='fab fa-linkedin-in' />
            <a
              href='https://www.linkedin.com/in/noah-cook-6b4054148/'
              target='_blank'
              rel='noopener noreferrer'
            >
              {' '}
              Linkedin
            </a>
          </li>
          <li>
            <i class='far fa-envelope' />
            <a
              href='mailto:imnoahcook@gmail.com'
              rel='noopener noreferrer'
              target='_blank'
            >
              {' '}
              imnoahcook@gmail.com
            </a>
          </li>
          <li>
            <i class='fab fa-github' />

            <a
              href='https://github.com/imnoahcook'
              rel='noopener noreferrer'
              target='_blank'
            >
              {' '}
              https://github.com/imnoahcook
            </a>
          </li>
        </ContactList>
      </AboutPanelContainer>
    </TallContainer>
  );
}

